import React from "react";
import Header from "./Header";
import { Main } from "./Main";
import Footer from "./Footer";

function ListPokemon() {
  return (
      <div>
        <Header/>
        <Main/>
        <Footer/>
      </div>

  );
}

export default ListPokemon;
